import React, {Component} from 'react';
import {Dropdown} from "react-bootstrap";
import {AiOutlineMore} from "react-icons/ai";

class DropdownUpdateDelete extends Component {
    constructor(props) {
        super(props);

        this.state = {
            id: this.props.id
        }

        this.updateFlight = this.updateFlight.bind(this)
        this.deleteFlight = this.deleteFlight.bind(this)
    }

    updateFlight(id) {
        // this.props.updateFlight(id)
        console.log(id)
    }

    deleteFlight(id) {
      //  this.props.deleteFlight(id)
        console.log(id)
    }


    render() {
        return (
            <Dropdown>
                <Dropdown.Toggle variant="" id="dropdown-basic">
                    <AiOutlineMore/>
                </Dropdown.Toggle>
                <Dropdown.Menu>
                    <Dropdown.Item
                        onClick={() => this.updateFlight(this.state.id)}>Update</Dropdown.Item>
                    <Dropdown.Item
                        onClick={() => this.deleteFlight(this.state.id)}>Delete</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        );
    }
}

export default DropdownUpdateDelete;
